import { NavLink } from 'react-router-dom';
import styles from './navigation.module.css';

const Navigation = () => (
  <nav>
    <NavLink
      exact
      to="/calendar_react/"
      className={styles.link}
      activeClassName={styles.activeLink}
    >
      Calendar
    </NavLink>

    <NavLink
      to="/calendar_react/authorisation"
      className={styles.link}
      activeClassName={styles.activeLink}
    >
      Authorisation
    </NavLink>
  </nav>
);

export default Navigation;
